select unique_id, count(1)
from bfp_sync_log bsl 
where bfpsyncstatusenum = 'SUCCESS'
and date_part('year', create_date) = date_part('year', now-14) 
and date_part('month', create_date) = 10
--and length(unique_id) > 8
group by 1 
having count(1) = 1
limit 100
;

